import React from 'react';

const UserProfile = ({ user }) => {
  const {
    timestamp,
    name,
    email,
    image,
    about,
    education,
    experience,
    skills,
    projects,
    certifications,
    awards,
    researchPapers,
  } = user;

  return (
    <div>
      <h2>Hi</h2>
    </div>
  );
};

export default UserProfile;
